import { FaGithub, FaExternalLinkAlt } from 'react-icons/fa';

function ProjectCard({ titulo, descripcion, imagen, tecnologias, code, live }) {
  return (
    <div className="project-card">
      <img src={imagen} alt={titulo} className="project-img" />
      <div className="project-details">
        <h3>{titulo}</h3>
        <p>{descripcion}</p>
        <div className="tech-stack">
          {tecnologias.map((tech, i) => (
            <span key={i} className="tech-tag">{tech}</span>
          ))}
        </div>
        <div className="buttons">
          {code && (
            <a href={code} target="_blank" rel="noopener noreferrer" className="btn">
              <FaGithub style={{ marginRight: "6px" }} />
              Code
            </a>
          )}
          {live && (
            <a href={live} target="_blank" rel="noopener noreferrer" className="btn">
              <FaExternalLinkAlt style={{ marginRight: "6px" }} />
              Live
            </a>
          )}
        </div>
      </div>
    </div>
  );
}

export default ProjectCard;
